@AlbertoBagnai @arrigoni_paolo Mio padre di 81 anni, lettore del Corriere da sempre, ha fatto l'abbonamento alla Verità. 
Questa pandemia sta aprendo varchi di consapevolezza.
Hanno peccato di hybris e tirato troppo la corda.  Contraddizioni, previsioni farlocche, dichiarazioni smentite dai fatti... troppo.

